    current_directory = ''
    for command in commands:
        if command == 'exit':
            return current_directory
        elif command.startswith('cd'):
            next_directory = command.split(' ')[1]
            if next_directory == '..':
                if current_directory != '/':
                    current_directory = '/'.join(current_directory.split('/')[:-1])
